import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

class AddContact extends Component {
  render() {
    return (
      <div className="main">
        <h1 style={{ color: "grey" }}>Add New Contact</h1>
        <div className="row">
          <div className="col-xs-12">
            <form>
              <div className="form-group">
                <label style={{ fontSize: "20px" }} for="fullname">
                  Fullname:
                </label>
                <input
                  style={{ marginLeft: "50px" }}
                  class="form-control"
                  type="text"
                  id="fullname"
                  name="fullname"
                  value=""
                />
              </div>
            </form>
          </div>
        </div>
      </div>
    );
  }
}

export default AddContact;
